import React from 'react';
import { Comparação, Meio, Requisitos} from './styles';
import {FaTachometerAlt, FaStopwatch, FaMobileAlt, FaBroadcastTower} from 'react-icons/fa';
import { Link } from 'react-router-dom';

export default function ComparativoGrande(){
    return (
        <Comparação>

            <h2>Comparação</h2>
            <h3>(4G e 5G)</h3>

            <Requisitos>
                <div><FaTachometerAlt size={35}/> Rapidez</div>
                <p><FaStopwatch/> Latência</p>
                <p><FaMobileAlt/> Dispositivos por km²</p>
                <p><FaBroadcastTower/> Frequência</p>
            </Requisitos>

            <Link to="/"></Link>
        </Comparação>

    );
}
